import React, { useState } from 'react';
import Navbar from "./components/Navbar/Navbar";
import {WindowNavbar, Dropdown} from "./components/Categories/Dropdown";
import { FoodCategories } from "./Categories/Foodcategories";
import './App.css';

function App() {

  const [selectedOption, setSelectedOption] = useState(FoodCategories[1]);

  const optionSelect = (event) => {
    console.log(event.target.value);
    setSelectedOption(event.target.value);

  };

  return (
    <div className="App">
      <Navbar />
      <WindowNavbar />
      <Dropdown onSelect={optionSelect}/>
    </div>
  );
}

export default App;
